    "analysis-of-the-wood-duck-nesting-box-program-on-wapanocca-national-wildlife-refuge-1977-1",nt"isopen":
    false,nt"url": null,nt"notes": "The wood duck nesting box program on Wapanocca
    National Wildlife Refuge has undergone transition and expansion throughout the years.
    These changes have occurred as a result of manpower availability, habitat restoration
    and management, and regional management guidance and directives. Additional wood
    duck boxes were constructed and placed in a manner which varied from year to year.
    The result was a mixture of box design, proximity and habitat factors. This study
    is an effort to analyze these factors and determine their variability in wood duck
    nesting success.",nt"license_title": "License Not Specified",nt"extras":
